import React from 'react';
import { useNavigate } from 'react-router-dom';
import './MainPage.css';

const MainPage = () => {
  const navigate = useNavigate();

  const handleButtonClick = () => {
    navigate('/function'); // Navigate to the function page
  };

  return (
    <div>
      <h1>Welcome to CollectPie</h1>
      <p>Your ultimate tool for collecting, managing, and mastering words and phrases from around the world.</p>
      <button onClick={handleButtonClick}>Get Started</button>
    </div>
  );
};

export default MainPage;
